llismo.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Il Dark Web</b><span style=\"font-weight: 400;\"> ‚Äì Un viaggio tra evoluzione, sicurezza e implicazioni moderne.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Privacy nei social media e nelle app di messaggistica</b><span style=\"font-weight: 400;\"> ‚Äì Strumenti pratici per gestire al meglio i tuoi dati personali.</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><b>Chi dovrebbe attivarlo?</b><b><br />\n</b><span style=\"font-weight: 400;\"><br />\n</span><span style=\"font-weight: 400;\">Studenti, lavoratori, genitori, educatori o semplici curiosi del mondo digitale: con l‚Äôaccount Full Vision impari a </span><b>proteggerti online</b><span style=\"font-weight: 400;\">, conoscere i tuoi diritti digitali e rimanere sempre aggiornato grazie all‚Äôaccesso a tutti i corsi disponibili.</span><span style=\"font-weight: 400;\"><br />\n</span></p>\n','[]','beginner',0,4999,4999,'instock',0,NULL,'EUR','[]','[\"online_course\", \"prodotti\"]','courses/1.-fullvisionimg1.jpg','[\"courses/2.-sicurezza_digitale.jpg\", \"courses/3.-scuola_bullismo.jpg\", \"courses/4.-gdpr_privacy.jpg\", \"courses/5.-ai-dark-web.jpg\"]',NULL,NULL,NULL,NULL,1,'active',0,0,'2025-04-11 13:15:17','2025-09-17 10:19:56','2025-09-17 10:19:56'),(12,14259,'Corso Online | Privacy online in vacanza: guida essenziale alla sicurezza digitale durante i viaggi','corso-online-privacy-online-in-vacanza-guida-essenziale-alla-sicurezza-digitale-durante-i-viaggi','Le vacanze sono il momento ideale per rilassarsi, ma purtroppo, √® anche quando siamo pi√π vulnerabili a rischi digitali.','<p><span style=\"font-weight: 400;\">Le vacanze sono il momento ideale per rilassarsi, ma purtroppo, √® anche quando siamo pi√π vulnerabili a rischi digitali. Durante l\'estate, abbassiamo la guardia: ci connettiamo a Wi-Fi pubblici senza pensarci, scarichiamo app locali, e condividiamo troppe informazioni sui social. Ma questi comportamenti possono esporci a furti d\'identit√†, truffe online, e perdita di dati sensibili.</span></p>\n<p><span style=\"font-weight: 400;\">Con questo corso, ti aiuteremo a proteggere la tua privacy online, affrontando i principali pericoli digitali che possono presentarsi mentre sei in vacanza. Imparerai come evitare le trappole pi√π comuni e come navigare in modo sicuro, riconoscendo i rischi e adottando buone abitudini digitali.</span></p>\n<h3><b>Cosa troverai nel corso:</b></h3>\n<p><span style=\"font-weight: 400;\">In questo corso, esploreremo i principali rischi digitali legati alle vacanze e scoprirai come proteggere i tuoi dati online:</span></p>\n<ul>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Wi-Fi pubblico</b><span style=\"font-weight: 400;\">: i rischi delle reti Wi-Fi gratuite e come connetterti in sicurezza.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>QR Code</b><span style=\"font-weight: 400;\">: come evitare truffe o malware nei QR Code utilizzati in hotel e ristoranti.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>App e permessi</b><span style=\"font-weight: 400;\">: perch√© scaricare app locali sconosciute pu√≤ essere pericoloso e come gestire i permessi.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Geolocalizzazione</b><span style=\"font-weight: 400;\">: come proteggere la tua privacy e limitare la geolocalizzazione del tuo smartphone.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Offerte di viaggio sospette</b><span style=\"font-weight: 400;\">: come riconoscere e evitare truffe legate ai pacchetti vacanza e altre offerte online.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Social Media</b><span style=\"font-weight: 400;\">: come condividere foto e informazioni sui social senza compromettere la tua sicurezza.</span></li>\n</ul>\n<h3><b>Destinatari del corso:</b></h3>\n<p><span style=\"font-weight: 400;\">Questo corso √® pensato per chiunque desideri proteggere i propri dati personali e la propria privacy mentre √® in vacanza. √à particolarmente utile per chi utilizza reti Wi-Fi pubbliche, scarica app locali, o condivide informazioni sui social. Il corso √® adatto a tutti, anche a chi ha poca esperienza digitale e vuole imparare a proteggersi in modo semplice e pratico.</span></p>\n','[]','beginner',0,999,NULL,'instock',0,NULL,'EUR','[\"Sicurezza informatica\"]','[\"online_course\", \"prodotti\"]','courses/privacy_estate_anteprima_1.jpg','[\"courses/privacy_estate_corso.jpg\"]',NULL,NULL,NULL,NULL,1,'active',0,0,'2024-12-31 15:15:48','2025-09-17 10:19:57','2025-09-17 10:19:57'),(13,13453,'Corso Online | Truffe WhatsApp: come difendersi e proteggere la tua privacy','corso-online-truffe-whatsapp-come-difendersi-e-proteggere-la-tua-privacy','Ogni giorno su WhatsApp milioni di utenti rischiano di cadere in truffe digitali.','<p><span style=\"font-weight: 400;\">Ogni giorno su WhatsApp milioni di utenti rischiano di cadere in truffe digitali. Immagina di ricevere un messaggio da un \"amico\" che ti chiede soldi per una \"emergenza urgente\" o una notifica che ti avvisa di una \"promozione esclusiva\" legata al tuo account bancario. Questi sono solo alcuni dei tentativi di frode che vengono veicolati su WhatsApp. </span><b>\"Truffe WhatsApp: come difendersi </b><b>e proteggere la tua privacy</b><span style=\"font-weight: 400;\">\" √® il corso che ti aiuta a proteggere il tuo profilo e le tue informazioni, per non diventare una vittima di queste truffe.</span></p>\n<h3><b>Cosa troverai nel corso:</b></h3>\n<ul>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Introduzione a WhatsApp e ai suoi rischi:</b><span style=\"font-weight: 400;\"> scopri come l‚Äôapp funziona e quali sono le problematiche di privacy.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Le truffe su WhatsApp: </b><span style=\"font-weight: 400;\">impara a riconoscere phishing, falsi profili e altre insidie comuni.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Tecniche usate dai truffatori: </b><span style=\"font-weight: 400;\">come si infiltrano nella tua vita digitale e come proteggerti.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Come proteggere la tua privacy: </b><span style=\"font-weight: 400;\">consigli pratici per utilizzare WhatsApp in modo sicuro.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><b>Gestire i dati personali e la sicurezza: </b><span style=\"font-weight: 400;\">come evitare che i tuoi dati vengano sfruttati senza il tuo consenso.</span></li>\n</ul>\n<h3><b>Destinatari del corso:</b></h3>\n<p><span style=\"font-weight: 400;\">Questo corso √® pensato per chiunque usi WhatsApp e desideri farlo in modo sicuro, indipendentemente dal livello di esperienza digitale. √à ideale per chi vuole approfondire la sicurezza dell‚Äôapp, comprendere i rischi e proteggere la propria identit√† digitale. Se vuoi essere pi√π consapevole su come WhatsApp raccoglie i tuoi dati e come proteggerti da tentativi di inganno, questo corso fa per te!</span></p>\n','[]','beginner',0,999,NULL,'instock',0,NULL,'EUR','[\"Sicurezza informatica\"]','[\"online_course\", \"prodotti\"]','courses/whatsapp_anteprima_1.jpg','[\"courses/whatsapp_corso.jpg\"]',NULL,NULL,NULL,NULL,1,'active',0,0,'2024-12-31 15:10:59','2025-09-17 10:19:57','2025-09-17 10:19:57'),(14,12925,'Corso Online | Come cancellare i tuoi dati dallo smartphone per rivenderlo, smaltirlo o regalarlo in sicurezza','corso-online-come-cancellare-i-tuoi-dati-dallo-smartphone-per-rivenderlo-smaltirlo-o-regalarlo-in-sicurezza','Come cancellare i tuoi dati dallo smartphone in modo sicuro e irreversibile prima di rivenderlo, regalarlo o smaltirlo? Ecco come proteggere i tuoi dati personali da occhi indesiderati.','<p><span style=\"font-weight: 400;\">Come cancellare i tuoi dati dallo smartphone in modo sicuro e irreversibile prima di rivenderlo, regalarlo o smaltirlo? Ecco come proteggere i tuoi dati persona