 corso ti guida passo dopo passo alla scoperta delle </span><b>regole fondamentali per lavorare in sicurezza</b><span style=\"font-weight: 400;\">, anche se non hai competenze tecniche.</span></p>\n<p><span style=\"font-weight: 400;\">Pensato per dipendenti, freelance, studenti e chiunque utilizzi strumenti digitali nel proprio contesto professionale, il corso fornisce </span><b>indicazioni pratiche, esempi concreti e strumenti immediati</b><span style=\"font-weight: 400;\"> per riconoscere minacce informatiche, adottare buone pratiche e difendersi nel digitale. Dalla gestione delle password alla protezione dei dispositivi mobili, fino al corretto uso dell‚Äôantivirus, acquisirai competenze essenziali per un comportamento sicuro e responsabile.</span></p>\n<h3><b>Cosa troverai nel corso</b></h3>\n<ul>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Le regole di base per usare il computer aziendale in modo sicuro.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Le buone pratiche per creare e proteggere le password.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Come riconoscere ed evitare virus e malware.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Le precauzioni per proteggere smartphone e tablet aziendali.</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">I consigli per lavorare da remoto in sicurezza (smart working).</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Il ruolo dell‚Äôantivirus e il suo utilizzo corretto.</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">Le basi della buona condotta digitale, utili in ogni contesto lavorativo.</span></p>\n<p><b>Questo corso √® offerto da</b><a href=\"https://campusdigitale.online\"> <b>CampusDigitale.online</b></a><b>, realt√† specializzata nella sicurezza informatica e nella protezione dei dati, con lo scopo di portare in Italia una formazione dedicata alla Cyber Security.</b></p>\n','[]','beginner',0,3499,NULL,'instock',0,NULL,'EUR','[\"Sicurezza informatica\"]','[\"online_course\", \"prodotti\"]','courses/cybersecurity_azienda_anteprima_1.jpg','[\"courses/cybersecurity_azienda_moduli_1.jpg\", \"courses/cybersecurity_azienda_docente.jpg\"]',NULL,NULL,NULL,NULL,1,'active',0,0,'2024-12-21 17:00:23','2025-09-17 10:20:07','2025-09-17 10:20:07'),(32,11537,'Corso Online | Introduzione alla NIS2: formazione per PMI e aziende della supply chain','corso-online-introduzione-alla-nis2-formazione-per-pmi-e-aziende-della-supply-chain','Questo corso fornisce un\'introduzione completa sulla Direttiva NIS2, con focus sui requisiti normativi e sulle implicazioni per le PMI e le aziende della supply chain.','<p><span style=\"font-weight: 400;\">Questo corso fornisce un\'introduzione completa sulla Direttiva NIS2, con focus sui requisiti normativi e sulle implicazioni per le PMI e le aziende della supply chain. Apprendi come gestire i rischi informatici, garantire la continuit√† operativa e trasformare la conformit√† normativa in un vantaggio competitivo.</span></p>\n<h3>Competenze che acquisirai:</h3>\n<ul>\n<li><span style=\"font-weight: 400;\">Capacit√† di comprendere e applicare i requisiti della Direttiva NIS2.</span></li>\n<li><span style=\"font-weight: 400;\">Identificazione e gestione dei rischi di sicurezza informatica.</span></li>\n<li><span style=\"font-weight: 400;\">Pianificazione di un percorso di adeguamento alla normativa per la tua azienda.</span></li>\n<li><span style=\"font-weight: 400;\">Implementazione di misure tecniche e organizzative per la protezione dei sistemi IT.</span></li>\n<li><span style=\"font-weight: 400;\">Capacit√† di segnalare e gestire incidenti di sicurezza in conformit√† con la normativa.</span></li>\n<li><span style=\"font-weight: 400;\">Monitoraggio continuo e documentazione della sicurezza aziendale.</span></li>\n<li><span style=\"font-weight: 400;\">Sviluppo di strategie per garantire la continuit√† operativa e la resilienza informatica.</span></li>\n<li><span style=\"font-weight: 400;\">Miglioramento della consapevolezza aziendale sulla cybersecurity attraverso la formazione del personale.</span></li>\n</ul>\n<p>&nbsp;</p>\n','[]','beginner',0,4999,NULL,'instock',0,NULL,'EUR','[\"Sicurezza informatica\"]','[\"online_course\", \"prodotti\"]','courses/introduzione_nis2.jpg','[\"courses/introduzione_nis2_argomenti.jpg\", \"courses/introduzione_nis2_docente.jpg\"]',NULL,NULL,NULL,NULL,1,'active',0,0,'2024-12-21 16:11:29','2025-09-17 10:20:08','2025-09-17 10:20:08'),(33,10450,'Corso online | Corso di formazione GDPR per incaricati al trattamento dei dati personali: gestire i dati in conformit√†','corso-online-corso-di-formazione-gdpr-per-incaricati-al-trattamento-dei-dati-personali-gestire-i-dati-in-conformita','Questo corso di formazione GDPR √® pensato per coloro che, nello svolgere le proprie mansioni lavorative, devono trattare dati personali (di clienti o fornitori o dipendenti ecc‚Ä¶).','<p><span style=\"font-weight: 400;\">Questo corso di formazione GDPR √® pensato per coloro che, nello svolgere le proprie mansioni lavorative, devono trattare dati personali (di clienti o fornitori o dipendenti ecc‚Ä¶).</span></p>\n<h2>Competenze che acquisirai:</h2>\n<ul>\n<li>Conoscenza approfondita del GDPR.</li>\n<li>Gestione del trattamento dei dati personali</li>\n<li>Classificazione e categorizzazione dei dati</li>\n<li>Sicurezza dei dati e prevenzione delle violazioni</li>\n<li>Responsabilit√† e ruoli chiave nel GDPR</li>\n<li>Gestione delle richieste di accesso ai dati</li>\n<li>Conoscenza del sistema sanzionatorio GDPR</li>\n<li>Formazione e sensibilizzazione del personale</li>\n<li>Adattamento delle aziende al GDPR</li>\n<li>Gestione delle violazioni dei dati.</li>\n</ul>\n','[]','beginner',0,6999,NULL,'instock',0,NULL,'EU