utili e applicazione di best practice operative.</span></li>\n<li><b>Sicurezza delle reti locali e remote</b><b><br />\n</b><span style=\"font-weight: 400;\"> Configurazione sicura di LAN, WLAN, firewall, VLAN, VPN e sistemi di rilevamento intrusioni (IDS/IPS) per proteggere l‚Äôinfrastruttura aziendale.</span></li>\n<li><b>Gestione credenziali e accessi</b><b><br />\n</b><span style=\"font-weight: 400;\"> Implementazione di autenticazione multifattoriale, politiche di accesso basate sui privilegi minimi e gestione sicura di account e password.</span></li>\n<li><b>Monitoraggio e risposta agli incidenti</b><b><br />\n</b><span style=\"font-weight: 400;\"> Introduzione a strumenti e tecnologie per il rilevamento e la gestione degli incidenti (SIEM, analisi log, threat intelligence).</span></li>\n<li><b>Sicurezza in ambienti cloud e mobile</b><b><br />\n</b><span style=\"font-weight: 400;\"> Best practice operative per sistemi BYOD, mobile device management (MDM) e sicurezza dei servizi cloud.</span></li>\n<li><b>Riferimenti normativi</b><b><br />\n</b><span style=\"font-weight: 400;\"> Applicazione operativa dei requisiti GDPR, NIS2 e standard di sicurezza nelle attivit√† quotidiane di gestione IT.</span></li>\n</ul>\n<h4></h4>\n<h4><b>Destinatari del corso</b></h4>\n<p><span style=\"font-weight: 400;\">Il corso √® pensato per tecnici informatici, sistemisti e professionisti IT operativi che desiderano:</span></p>\n<ul>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">aggiornare e affinare le proprie competenze in cybersecurity;</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">applicare soluzioni operative per proteggere reti, endpoint e sistemi aziendali;</span></li>\n<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">gestire in modo efficace incidenti e vulnerabilit√† reali.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\">√à ideale per chi lavora in contesti aziendali senza un SOC interno o vuole completare la propria formazione pratica in sicurezza operativa.</span></p>\n','[]','beginner',0,6999,NULL,'instock',0,NULL,'EUR','[\"Sicurezza informatica\"]','[\"online_course\", \"prodotti\"]','courses/tecnici_IT_anteprima_1.jpg','[\"courses/cybersecurity_tecniciIT_docente.jpg\", \"courses/cybersecurity_corso.jpg\"]',NULL,NULL,NULL,NULL,1,'active',0,0,'2024-12-10 15:20:35','2025-09-17 10:20:09','2025-09-17 10:20:09');
