INSERT INTO `help_sections` VALUES (1,'Benvenuto su Campus Digitale Forma','benvenuto-campus-digitale-forma','Guida introduttiva per iniziare a utilizzare la piattaforma','# Benvenuto su Campus Digitale Forma! üéì\n\nCampus Digitale Forma √® la tua piattaforma di apprendimento online che ti permette di accedere a corsi di alta qualit√†, ottenere certificazioni e tracciare i tuoi progressi.\n\n## Cosa puoi fare:\n\n- **Iscriviti ai corsi** che ti interessano\n- **Segui le lezioni** al tuo ritmo\n- **Completa i quiz** per testare le tue conoscenze\n- **Ottieni certificati** al completamento dei corsi\n- **Guadagna badge** e punti per i tuoi achievement\n- **Partecipa alla classifica** globale\n\n## Come iniziare:\n\n1. **Completa il tuo profilo** con le informazioni personali\n2. **Esplora il catalogo** dei corsi disponibili\n3. **Iscriviti al tuo primo corso**\n4. **Inizia a imparare!**\n\nHai domande? Consulta le altre sezioni di help o contatta il supporto!','general','academic-cap','#3B82F6',1,1,1,'[\"introduzione\", \"inizio\", \"guida\"]',NULL,NULL,NULL,0,0,0,'2025-09-16 08:38:01','2025-09-16 08:38:01'),(2,'Come navigare nella piattaforma','navigazione-piattaforma','Impara a muoverti facilmente tra le diverse sezioni','# Navigazione nella Piattaforma üß≠\n\n## Menu Principale\n\n### Dashboard\n- **Home**: La tua dashboard personale con corsi in corso e progressi\n- **Corsi**: Catalogo completo di tutti i corsi disponibili\n- **I Miei Corsi**: I corsi a cui sei iscritto\n- **Certificati**: I tuoi certificati ottenuti\n- **Notifiche**: Centro notifiche per aggiornamenti\n- **Gamification**: I tuoi punti, badge e posizione in classifica\n\n### Profilo\n- **Impostazioni**: Modifica le tue informazioni personali\n- **Preferenze**: Configura notifiche e impostazioni\n- **Sicurezza**: Gestisci password e autenticazione\n\n## Barra di Ricerca\nUtilizza la barra di ricerca in alto per:\n- Cercare corsi specifici\n- Trovare sezioni di help\n- Localizzare contenuti rapidamente\n\n## Filtri e Ordinamento\n- **Categoria**: Filtra per argomento\n- **Livello**: Principiante, Intermedio, Avanzato\n- **Durata**: Ordina per tempo di completamento\n- **Popolarit√†**: I corsi pi√π seguiti','general','map','#3B82F6',2,1,0,'[\"navigazione\", \"menu\", \"ricerca\"]',NULL,NULL,NULL,0,0,0,'2025-09-16 08:38:01','2025-09-16 08:38:01'),(3,'Come iscriversi a un corso','iscriversi-corso','Guida passo-passo per iscriversi a un corso','# Come Iscriversi a un Corso üìö\n\n## Passo 1: Esplora il Catalogo\n1. Vai alla sezione **\"Corsi\"** dal menu principale\n2. Sfoglia i corsi disponibili o usa i filtri\n3. Clicca su un corso per vedere i dettagli\n\n## Passo 2: Leggi le Informazioni\n- **Descrizione**: Contenuti e obiettivi del corso\n- **Durata**: Tempo stimato per il completamento\n- **Livello**: Difficolt√† (Principiante, Intermedio, Avanzato)\n- **Prerequisiti**: Conoscenze richieste\n- **Certificato**: Se viene rilasciato un attestato\n\n## Passo 3: Iscriviti\n1. Clicca sul pulsante **\"Iscriviti\"**\n2. Conferma la tua iscrizione\n3. Il corso apparir√† in **\"I Miei Corsi\"**\n\n## Passo 4: Inizia a Imparare\n1. Vai in **\"I Miei Corsi\"**\n2. Clicca su **\"Inizia Corso\"**\n3. Segui le lezioni nell\'ordine indicato\n\n## Note Importanti:\n- Puoi iscriverti a pi√π corsi contemporaneamente\n- I corsi non hanno scadenza\n- Puoi riprendere da dove hai interrotto\n- Il progresso viene salvato automaticamente','courses','academic-cap','#10B981',1,1,1,'[\"iscrizione\", \"corsi\", \"inizio\"]',NULL,NULL,NULL,0,0,0,'2025-09-16 08:38:01','2025-09-16 08:38:01');
